member.summary:
Request del método /SetPOSSupply del controlador TPVTransactions del servicio WSTPVTransactions (WSTPVTransactions/TPVTransactions/SetPOSSupply).
El modelo de entrada del servicio se llama SupplyDocumentList, pero aquí lo hemos llamado SetPOSSupplyRequest porque nos creaba confusión, ya que no es
una implementación específica de ninguna interfaz que defina una colección de datos, si no un modelo que dentro contiene un objecto IList{T}
